import React, { useEffect, useState } from "react";
import { fetchCareerData } from "./api";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getData = async () => {
      const result = await fetchCareerData();
      setData(result);
    };
    getData();
  }, []);

  return (
    <div>
      <h1>Career Data</h1>
      {data ? <pre>{JSON.stringify(data, null, 2)}</pre> : <p>Loading...</p>}
    </div>
  );
}

export default App;
